import React from "react";
import styled from "styled-components";

const Container = styled.div``;

export const Instruction: React.FC<{ title: string }> = (title, children) => {
  return (
    <Container>
      <h1>{title}</h1>
      <div>{children}</div>
    </Container>
  );
};
